import React,{useState} from 'react';
import { Chart } from 'react-google-charts';
import {HiTrendingUp} from "react-icons/hi"; 
import styles from "./AreaCard.module.css";
export const data = [
    ["Day", ""],
    ["M", 0],
    ["T", 150],
    ["W", 50],
    ["Th", 60],
    ["F", 200],
    ["S", 10],
  ];
  
  export const options = {
    hAxis: { title: ["M","T","W","Th","F"] },
    vAxis: { minValue: 0 },
    chartArea: { width: "50%", height: "90px" },
    colors: ['#055e0e'],
  };
export default function AreaCard({work,number,count,profit}) {
 return (
     <>
     <div className={styles.chart} id="chart">
       <p>{work}</p> 
       <div style={{display:"flex"}}>
        <div>
            <div style={{display:"flex",flexDirection:"column",alignItems:"center"}}>
            <h5>{number}</h5>
            {profit?(
             <div style={{display:"flex"}}>   
             <div id='profit' style={{display:"flex",background:"#98d490"}}>
                <HiTrendingUp size={15} color='#055e0e'/><p style={{fontSize:"10px"}}>20%</p></div>
                <p style={{fontSize:"10px"}}>{count}</p>
              </div>  
            ):(
            <div id='profit' style={{display:"flex",background:"#e8898f"}}>
                <HiTrendingUp size={15} color='#7d0c14'/>20%</div>
              )
             }
            </div>
        </div>  
        <Chart
          chartType="AreaChart"
          width="100%"
          height="90px"
          data={data}
          options={options}
           />
       </div>
   
     </div>
     </>
     )
}
